import React from 'react'
import { CircularProgress } from '@material-ui/core'
import { ContainerLoading } from './styled'

const Loading = () => {

    return (
        
        <ContainerLoading>
            <CircularProgress />
        </ContainerLoading>
    )
}

export default Loading
